import React from 'react'

import Button from '@mui/material/Button'
import Fab from '@mui/material/Fab'
import { TableCell, TableRow } from '@mui/material'

export default function Week() {
  return (
        <>
            <TableRow>
                {props.week.map((day) => {
                    <TableCell key={day}>
                        {
                            <Fab>
                                { day.getDate() }
                            </Fab>
                        }
                    </TableCell>
                })}
            </TableRow>
        </>
    )
}
